#   {date: "2019-08-18", route_id: 365, grade: "5.10a", result: "redpoint", in_progress: nil, rating: nil, partner: "N/A", comments: "Great climb in the corner between Wet Dream and Reefer. Fun stemming and movement. The crux at the top is all about footwork and correct placement", collection_id: nil, user_id: user1.id},
#   {date: "2019-09-15", route_id: 104, grade: "5.10b/c", result: "flash", in_progress: nil, rating: nil, partner: "N/A", comments: "Great warmup. Small roof and some sustained climbing. Little Eiger is great for long and fun routes", collection_id: nil, user_id: user1.id},
#   {date: "2019-09-15", route_id: 104, grade: "5.10b/c", result: "flash", in_progress: nil, rating: nil, partner: "N/A", comments: "Another fun and long route. This one has a tricky dihedral and also a slightly overhung move. Felt great on this one. Really a good lead and good route, especially to get into the lead zone", collection_id: nil, user_id: user1.id},
#   {date: "2019-09-15", route_id: 44, grade: "5.10d", result: "flash", in_progress: nil, rating: nil, partner: "N/A", comments: "Very fun slab climbing until a big roof with awesome jugs. I would like to do all 4 pitches of this route sometime", collection_id: nil, user_id: user1.id},
#   {date: "2019-09-19", route_id: 313, grade: "5.10a", result: "flash", in_progress: nil, rating: nil, partner: "N/A", comments: "Nice warmup. There were a couple tricky spots, but a great route to get comfortable for a day climbing outside", collection_id: nil, user_id: user1.id},
#   {date: "2019-09-19", route_id: 345, grade: "5.11a", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "Pumped myself out early and then had a really difficult time figuring out the crux. Definitely harder to move right and up on the crux. John found an easier move to go straight up off of the nice left hand at the start of the crux", collection_id: nil, user_id: user1.id},
#   {date: "2019-09-19", route_id: 345, grade: "5.11a", result: "redpoint", in_progress: nil, rating: nil, partner: "N/A", comments: "Used John's beta and sent the route easily. I flew through the bottom and pulled the crux easily to get over the roof to the anchors. Climbing a route more than once really makes a huge difference", collection_id: nil, user_id: user1.id},
#   {date: "2019-10-02", route_id: 199, grade: "5.12a/b", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "This was such a cool climb. The beginning had a fun layback and some big moves to smaller crimps. I felt great on that section, but then you get to the crux on the last couple bolts. I wasn't able to stay on the wall for these moves, but it was sure fun trying it over and over on the rope.", collection_id: nil, user_id: user1.id},
