#   {date: "2019-05-03", route_id: 242, grade: "5.10c", result: "1 fall", in_progress: nil, rating: nil, partner: "N/A", comments: "Tough warmup, but super fun route. Climb on the left wedge after an easy start. Can send next time in Moab", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-03", route_id: 243, grade: "5.10a", result: "1 fall", in_progress: nil, rating: nil, partner: "N/A", comments: "Such an amazing route. Pretty tough, but typical for Moab. Definitely need a stick clip. The climbing is sustained and so much fun all the way up", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-04", route_id: 232, grade: "5.11a", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "This climb was awesome. I cant wait to come back and do battle with this one", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-04", route_id: 229, grade: "5.12c", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "Followed Matt after he led and bailed around the 5th bolt. The start is incredible and then you get to the arete which is definitely where the 5.12c comes in. This could be a lofty goal for the recurring trips to Moab", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-05", route_id: 241, grade: "5.9", result: "flash", in_progress: nil, rating: nil, partner: "N/A", comments: "Nice warmup. Very slabby with a difficult start", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-05", route_id: 233, grade: "5.11b", result: "beta", in_progress: true, rating: nil, partner: "N/A", comments: "MOAB PROJECT. This route is so much freaking fun. Hard and sustained moves with a difficult start, but there are some good rests. I was proud to get to the top of this on lead, but I had to cheat on the start and at the last big move to the small crimps. Will return", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-11", route_id: 284, grade: "5.11b", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "Tough roof to start with - couldn't get it this time (tired from Bouldering the previous day when Zoe got me a training session for my bday :D). The climbing get pretty fun after the roof with a little more difficulty as you get close to the anchors", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-11", route_id: 177, grade: "5.12a", result: "beta", in_progress: true, rating: nil, partner: "N/A", comments: "This route is really awesome. I would love to come back and give it more attempts", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-11", route_id: 349, grade: "5.11a", result: "2 falls", in_progress: nil, rating: nil, partner: "N/A", comments: "AMAZING CLIMB. The whole route is fun with really great holds and sustained shoulder and back pressure. I cant wait to come back and send this. The move to the anchor stumped me for a bit, but it is easily pulled by using a left foot heel hook and reaching up to the pinch with your left hand", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-18", route_id: 164, grade: "5.8", result: "flash", in_progress: nil, rating: nil, partner: "N/A", comments: "Good warmup. Wasn't a huge fan of there not being an anchor and having to traverse and lower weirdly. Zoe didn't like top-roping this one", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-18", route_id: 335, grade: "5.10d", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "AMAZING CLIMB. Really sustained climbing. Feels harder than 10d, but that is the Monastery for ya. I love this place so freaking much and this climb is one that I will repeat over and over. I really hope that someone updates the hardware on the anchor soon tho", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-25", route_id: 297, grade: "5.10b/c", result: "flash", in_progress: nil, rating: nil, partner: "N/A", comments: "Super fun route. Kind of a tough warmup due to pump, but there were good rest along the climb. I really liked this area (about 5-10 routes right of Crynoid Corner)", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-25", route_id: 299, grade: "5.10c", result: "flash", in_progress: nil, rating: nil, partner: "N/A", comments: "Very fun. Thought it was easier than Three-Quarter Ton. A few tough moves", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-25", route_id: 254, grade: "5.11b/c", result: "2 falls", in_progress: true, rating: nil, partner: "N/A", comments: "Awesome climbing. Figured out my sequence to pull the crux. Would love to come back for the send", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-25", route_id: 282, grade: "5.11b", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "This route is amazing. Sustained climbing on the face and arete. So much fun. Feet are key! This is a Cactus Cliff project for sure.", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-25", route_id: 248, grade: "5.11d", result: "beta", in_progress: true, rating: nil, partner: "N/A", comments: "Tuck and I were so pumped when we got on this. Neither of us could clip the 5th bolt on the crimp. I tried again and was ready to get it and realized I didn't have any draws, so we bailed lol. Would really love to come back to this. It was an awesome climb.", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-26", route_id: 307, grade: "5.10a", result: "flash", in_progress: nil, rating: nil, partner: "N/A", comments: "Good warmup with a tough middle crux section", collection_id: nil, user_id: user1.id},
#   {date: "2019-05-26", route_id: 348, grade: "5.11a", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "Roofs are very tough for me, but I still had a fun time on this one. Roofs are not intuitive for me, but once I find the right foot position then I can typically pull it. I just need more practice so that I can read my foot positioning better", collection_id: nil, user_id: user1.id},
