#   {date: "2020-04-05", route_id: 247, grade: "5.11d", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "Very unique and technical climb. Similar to Feeding Frenzy. Not sure which I like better, but neither are necessarily my style of climbing. Still great to get on these kind of climbs and push out of my comfort zone. I just don't get that same fire to send these types, but I am always willing to support Tuck on these cause I know that this is his style", collection_id: nil, user_id: user1.id},
#   {date: "2020-04-05", route_id: 273, grade: "5.11b", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "Such an amazing climb over a wide and sloping arete. I can't believe how cool this one is. Definitely in my top 3 North Table climbs (Industrial, Roseanne & Electrocuticles). It was tricky to figure out the moves on the initial lead, but this is definitely a beta dependent climb", collection_id: nil, user_id: user1.id},
#   {date: "2020-04-05", route_id: 273, grade: "5.11b", result: "redpoint", in_progress: nil, rating: nil, partner: "N/A", comments: "Cruised it on my second try!! I was bold and moved well through the cruxes. This route is definitely the style that ignites my fire for climbing and conquering routes. Love this climb", collection_id: nil, user_id: user1.id},
#   {date: "2020-04-05", route_id: 186, grade: "5.12a", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "Tough and fun route, with some great crimps up top. The first low crux is very difficult and would require really dialing in the beta. Then you get an easier middle section that leads to some fun, very small crimps with good movement and then a big move to get a left hand on the arete. Fun climb for sure", collection_id: nil, user_id: user1.id},
#   {date: "2020-04-05", route_id: 3, grade: "5.12a", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "This climb was actually pretty awesome. Tuck got on TR first and worked some of the moves, but he went left (which I think is off route). I was able to find the moves straight up the arete. I would certainly like to get on this one more and would definitely like to get the lead soon", collection_id: nil, user_id: user1.id},
#   {date: "2020-04-05", route_id: 249, grade: "5.11d", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "Very interesting start that leads to a difficult overhanging headwall. Super fun route - tough at the end of the day. This would be an awesome climb to pursure in order to gauge my endurance", collection_id: nil, user_id: user1.id},
