#   {date: "2020-04-07", route_id: 6, grade: "5.11c", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "This climb is seriously awesome. Tricky section at the bottom that leads into a really amazing roof with some of the best crimps I have ever grabbed at North Table. I am certainly going to get on lead soon and work for the send", collection_id: nil, user_id: user1.id},
#   {date: "2020-04-07", route_id: 354, grade: "5.11a", result: "flash", in_progress: nil, rating: nil, partner: "N/A", comments: "I will consider this a flash because I set the draws and hadn't been on this for at least 6 months. It was a great test to show how much my strength has improved. I climbed it sloppily and set the draws and still got the send. Really happy about that", collection_id: nil, user_id: user1.id},
#   {date: "2020-04-10", route_id: 95, grade: "5.10c", result: "1 fall", in_progress: nil, rating: nil, partner: "N/A", comments: "Another good warmup - need to know the beta on the roof pull", collection_id: nil, user_id: user1.id},
#   {date: "2020-05-02", route_id: 193, grade: "5.12a", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "Topped out on lead! I was so pumped at this point, but I am really proud that I got the full lead on such a difficult route. I feel like this one will come soon", collection_id: nil, user_id: user1.id},
#   {date: "2020-04-10", route_id: 73, grade: "5.11d", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "Really amazing climb! The beginning section is just fun and cruiser and then you get a fun roof pull. After the roof is where the business starts and you gotta figure you way through some really small holds and almost no feet. Will take some time to dial in the beta on this one, but I am definitely going for the send soon", collection_id: nil, user_id: user1.id},
#   {date: "2020-04-11", route_id: 347, grade: "5.11a", result: "onsight", in_progress: nil, rating: nil, partner: "N/A", comments: "Really great climb. I felt so solid on this - I said it was the easiest 11a I've ever climbed when I got to the top haha. This being the 4th day outside that week made me feel super relaxed and comfortable on the rock. It felt good to see a few other groups struggle on this, so it shows me that when I am dialed in and have some reps, I can really climb with a good head", collection_id: nil, user_id: user1.id},
#   {date: "2020-04-11", route_id: 174, grade: "5.12a", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "Crazy roof with a gnarly overhanging hand jam that goes into a sharp, good flake for a huge lock-off to pull the roof. The feet are everything when you have the sharp flake and I just couldn’t seem to get my right foot solid in the crack", collection_id: nil, user_id: user1.id},
#   {date: "2020-04-11", route_id: 174, grade: "5.12a", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "Gave this route quite a few burns trying to pull the roof. Not my favorite style of climbing, but it would be satisfying to get the roof. I think this would be a good test to see improvement as my lock-off strength continues to improve", collection_id: nil, user_id: user1.id},
#   {date: "2020-04-11", route_id: 207, grade: "5.11a", result: "onsight", in_progress: nil, rating: nil, partner: "N/A", comments: "Such an awesome beginning. Can't imagine how hard the trad section is, but this was a fun and slightly challenging beginning", collection_id: nil, user_id: user1.id},
