#   {date: "2020-05-02", route_id: 193, grade: "5.12a", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "This climb is hard, but awesome. Lots of pockets, some good some bad, technical and thin foot placements, some small crimps, some nice sidepulls. Overall a difficult, engaging and classic route. This is my current main project at Shelf", collection_id: nil, user_id: user1.id},
#   {date: "2020-05-02", route_id: 193, grade: "5.12a", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "Worked out more of the moves. The most challenging part of the climb for me is foot placement and finding the right feet quickly so that I don't put too much strain on my fingers & forearms", collection_id: nil, user_id: user1.id},
#   {date: "2020-05-02", route_id: 193, grade: "5.12a", result: "beta", in_progress: nil, rating: nil, partner: "N/A", comments: "Got my beta pretty dialed in. Need to remember specific pockets for my feet, foot placement before committing to moves, trust the clipping stance with the wide counter balance foot, try to save as much energy as possible in the intro - get to the ledge quickly", collection_id: nil, user_id: user1.id},
#   {date: "2020-05-02", route_id: 248, grade: "5.11d", result: "beta", in_progress: true, rating: nil, partner: "N/A", comments: "Such a great climb. Classic for sure. Super sustained climbing on good holds with some heady feet and runouts. Real attempt needs to be done with a full tank. I'll get this one in the near future, but Gym Arete is my Shelf focus for now", collection_id: nil, user_id: user1.id},
