#   {date: "2020-05-10", route_id: 171, grade: "5.12a", result: "beta", in_progress: true, rating: nil, partner: "N/A", comments: "First lead attempt! It went really well through the bottom 11+ climbing. I willed my way through the first crux (it was close, but I was so focused and in the zone) but when I got to the top crux I was pretty pumped and fell quickly. It took a while for me to dial in the top crux, but once I found the beta I actually moved through it pretty well. The little horn for your left hand (after the crux sequence) is surprisingly nice to clip off of. It looks small but it is pretty nice. Then move right to the nice flaky holds next to each other and DONT FORGET the left hand bump up to the nice crimp, and then set up and make the dyno", collection_id: nil, user_id: user1.id},
