#   {date: "2020-05-19", route_id: 6, grade: "5.11c", result: "2 falls", in_progress: nil, rating: nil, partner: "N/A", comments: "This was my best attempt in terms of beta, but I was just so pumped. I know that I can get this route next time. I need to stay low and fairly horizontal after the roof pull (instead of standing up) and then I can position to make the moves to gain the face to the left of the roof section. I think I will get this next time", collection_id: nil, user_id: user1.id},
#   {date: "2020-05-19", route_id: 253, grade: "5.11b/c", result: "beta", in_progress: true, rating: nil, partner: "N/A", comments: "This route is seriously cool. Very tricky and low percentage move through the thin and technical crux. Otherwise the route is really fun and easy. Would love to get the send on this one", collection_id: nil, user_id: user1.id},
#   {date: "2020-05-19", route_id: 253, grade: "5.11b/c", result: "beta", in_progress: true, rating: nil, partner: "N/A", comments: "Went for the send in the dark! Felt pretty good, but I just didn't stick the crux move on the first go. The key is to cut the right foot and put all pressure on the tiny left toe edge in order to get enough purchase to stand and fall onto the right hand on the big ledge. This was probably the windiest climb I have ever done, so that was kind of fun", collection_id: nil, user_id: user1.id},
#   {date: "2020-05-23", route_id: 305, grade: "5.10c", result: "2 falls", in_progress: nil, rating: nil, partner: "N/A", comments: "I would say this is one of the only routes that I would say is bad. It's just really insecure and not very fun climbing that almost seems like it's not worth it. Probably won't be back to this one. But it was nice to get on something while we waited for Hot Zone", collection_id: nil, user_id: user1.id},
